import React, { useState } from 'react';

function MyForm() {
  // State for dropdown and currency input
  const [selectedOption, setSelectedOption] = useState('');
  const [currencyAmount, setCurrencyAmount] = useState('');

  // Dropdown options
  const dropdownOptions = ['Option 1', 'Option 2', 'Option 3'];

  // Event handler for dropdown change
  const handleDropdownChange = (event) => {
    setSelectedOption(event.target.value);
  };

  // Event handler for currency input change
  const handleCurrencyInputChange = (event) => {
    setCurrencyAmount(event.target.value);
  };

  // Submit handler (you can add your form submission logic here)
  const handleSubmit = (event) => {
    event.preventDefault();
    // Your form submission logic here
  };

  return (
    <form onSubmit={handleSubmit} className="form-container">
      <label>
        Dropdown:
        <select value={selectedOption} onChange={handleDropdownChange}>
          <option value="">Select an option</option>
          {dropdownOptions.map((option, index) => (
            <option key={index} value={option}>
              {option}
            </option>
          ))}
        </select>
      </label>
      <label>
        Currency:
        <input
          type="number"
          value={currencyAmount}
          onChange={handleCurrencyInputChange}
          placeholder="Enter amount"
        />
      </label>
      <button type="submit">Submit</button>
    </form>
  );
}

export default MyForm;
